import React from 'react'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import { Toaster } from 'react-hot-toast'
import Home from './pages/Home'
import Login from './pages/auth/Login'
import Register from './pages/auth/Register'
import StudentDashboard from './pages/dashboard/StudentDashboard'
import ProtectedRoute from './components/auth/ProtectedRoute'

// Import student feature components
import SubmitReport from './pages/student/SubmitReport'
import RegisterInternship from './pages/student/RegisterInternship'
import MentorEvaluation from './pages/student/MentorEvaluation'
import TeacherEvaluation from './pages/student/TeacherEvaluation'
import EditProfile from './pages/student/EditProfile'
import PreliminaryCheck from './pages/student/PreliminaryCheck'
import InternshipDuration from './pages/student/InternshipDuration'

const App = () => {
  return (
    <Router>
      <div className="min-h-screen bg-background font-sans antialiased">
        <Toaster position="top-right" />
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* Protected Routes */}
          <Route path="/dashboard" element={
            <ProtectedRoute>
              <StudentDashboard />
            </ProtectedRoute>
          } />

          {/* Student Feature Routes */}
          <Route path="/dashboard/submit-report" element={
            <ProtectedRoute>
              <SubmitReport />
            </ProtectedRoute>
          } />
          <Route path="/dashboard/register-internship" element={
            <ProtectedRoute>
              <RegisterInternship />
            </ProtectedRoute>
          } />
          <Route path="/dashboard/mentor-evaluation" element={
            <ProtectedRoute>
              <MentorEvaluation />
            </ProtectedRoute>
          } />
          <Route path="/dashboard/teacher-evaluation" element={
            <ProtectedRoute>
              <TeacherEvaluation />
            </ProtectedRoute>
          } />
          <Route path="/dashboard/edit-profile" element={
            <ProtectedRoute>
              <EditProfile />
            </ProtectedRoute>
          } />
          <Route path="/dashboard/preliminary-check" element={
            <ProtectedRoute>
              <PreliminaryCheck />
            </ProtectedRoute>
          } />
          <Route path="/dashboard/internship-duration" element={
            <ProtectedRoute>
              <InternshipDuration />
            </ProtectedRoute>
          } />
        </Routes>
      </div>
    </Router>
  )
}

export default App
